import React from "react";

const Controls = ({ onMove, disabled }) => (
  <div style={{ margin: "20px" }}>
    <button disabled={disabled} onClick={() => onMove("up")}>↑ Up</button>{" "}
    <button disabled={disabled} onClick={() => onMove("left")}>← Left</button>{" "}
    <button disabled={disabled} onClick={() => onMove("down")}>↓ Down</button>{" "}
    <button disabled={disabled} onClick={() => onMove("right")}>→ Right</button>
  </div>
);

export default Controls;
